import React from "react";

export default function ConpleteOrder(){
    return(
        <div style={{color:"darkorange"}}>
        <h1 style={{fontSize:"2vw", color:"darkorange"}}>Chúc Mừng !</h1>
        <h1 style={{fontSize:"2vw", color:"darkorange"}}>Đơn hàng của bạn đã được đặt thành công !</h1>
        <p><strong style={{color:"white"}}>Xin hãy giữ liên lạc !</strong><br/>Nhân viên chúng tôi sẽ liên hệ với bạn để xác nhận đơn hàng trong ít phút.</p>
        <p><strong style={{color:"white"}}>Vui lòng đợi chúng tôi.</strong> Đơn hàng sẽ được giao đến bạn trong 45' sau khi xác nhận đơn hàng.</p>
        </div>
    )
}
